import React, { useState, useEffect } from 'react'

function App() {
  
   const [data, setData] = useState([{}])

   useEffect(()=>{
         fetch("/homepage").then(
            res => res.json()
         ).then(
               data => {
                  setData(data)
                  console.log(data)
               }
         )
      }, [])

    return (
    <div>
     {(typeof data.homepage ==='undefined') ? (
      <h>Undefined</h>
     ):(
         data.homepage.map((homepage,i) =>
            <h key ={0}>{homepage}</h>)
            )}
    </div>
  )
}

export default App
